    this.getClientData();
    return (
        <div className='root' style={{width: this.props.width}}>
          <GridList cellHeight={200} className='gridList' cols={1}>
            {tileData.map(tile => (
              <GridListTile key={tile.img} cols={1}>
                <img src={tile.img} alt={tile.title} />
                <GridListTileBar
                  title={tile.title}
                  subtitle={<span>by: {tile.author}</span>}
                />
              </GridListTile>
            ))}
          </GridList>
        </div>
      );
  }

}
